import React from 'react';
import { HaidilaoLogoMini } from '../../asset/images/restaurant_info/haidilao/index.js';
import { StarIcon, TimeIcon } from '../../asset/icons/box/index.js';

const Information = ({ type }) => {
  let content;

  switch (type) {
    case 'table_number':
      content = 'Table No.15';
      break;
    case 'address':
      content = 'L3 Vincom Center, 72 Lê Thánh Tôn, P. Bến Nghé, Quận 1, TP. HCM.';
      break;
  }

  return (
    <div className="flex flex-col items-center justify-center min-h-screen">
      <div className="w-299 h-120 border border-placeholders rounded-lg flex flex-col items-center justify-center">
        {/* Top section */}
        <div className="flex flex-col items-center p-2">
          <div className="flex items-center">
            <HaidilaoLogoMini className="w-25 h-25 rounded-full" />
            <h1 className="ml-2">Haidilao - Dong Khoi</h1>
          </div>
          <div className="flex items-center mt-2">
            <StarIcon className="w-5 h-5" />
            <p className="ml-1 text-primary">4.9 (284)</p>
            <TimeIcon className="w-5 h-5 ml-4" />
            <p className="ml-1 text-primary">15-25 mins</p>
          </div>
        </div>
        {/* Section divider */}
        <hr className="border border-placeholders w-4/5" />
        {/* Bottom section */}
        <div className="p-2 text-center">
          <p className="mb-2">{content}</p>
        </div>
      </div>
    </div>
  );
};

export default Information;
